Pare um pouco...
Silencie....
Acalme a mente...
E sinta uma nova atmosfera lhe envolver.
Hoje é um novo dia.
Que a paz de Jesus possa aquecer sua alma.
Eis a hora de se afastar dos fatos que tanto desequilibram.
Eis a hora de aliviar o seu sofrimento.

Pense em Jesus!
Veja a sua Luz a tudo iluminar.
Os problemas passam.
Confie! E compreenda a importância de manter a serenidade nos momentos de crise.
Com calma e fé tudo se vence.
Porque desse modo sente que realmente  não encontra-se sozinho.

Cristo está contigo!
Quanta paz! Eleve seu padrão vibratório.
Alimente sua mente com mais otimismo.

Gasta tanta energia focando apenas nos ressentimentos e nos problemas que ainda não sabe como resolver.
É  preciso higienizar o seu íntimo.

Deixe O Grande Médico das almas cuidar de você.
Jesus!
Ele lhe sustentará nas batalhas do dia a dia.
E fará muito mais.
Com Jesus você compreenderá um novo sentido para a sua existência. 

Eis a hora.
Não perca mais tempo!
O sol da esperança brilha e é chegado o momento de abrir a porta da sua alma. 

Não tema!
É Jesus, o Bom Pastor que iluminara o caminho.

Assim sempre será!!!! 🙌🏻🙏🏻🌿🌻☀️🦋
